y=df['Wage']
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.4, random_state=0)


# Create a list of models to be trained
models = []
models.append(('LR', LinearRegression()))
models.append(('DT', DecisionTreeRegressor()))
models.append(('RF', RandomForestRegressor()))
models.append(('SVM', SVR()))
models.append(('KNN', KNeighborsRegressor()))
models.append(('AdaB', AdaBoostRegressor()))
models.append(('GraB', GradientBoostingRegressor()))
models.append(('XGB', XGBRegressor()))

# Evaluate each model in turn
results = []
names = []
for name, model in models:
    # Create a pipeline to scale the features and train the model
    pipeline = make_pipeline(StandardScaler(), model)
    
    # Train the model
    pipeline.fit(X_train, y_train)
    
    # Make predictions on the testing set
    y_pred = pipeline.predict(X_test)
    
    # Calculate the R^2 score
    r2 = r2_score(y_test, y_pred)
    
    # Store the results
    results.append(r2)
    names.append(name)
    print(f"{name}: {r2}")

# Print the results
print(f"Model R^2 scores: {results}")

