#function to find mae of different tree sized
def tree_depth_error(max_nodes,X_train,X_test, y_train,y_test):
    wage_model = RandomForestRegressor(max_leaf_nodes=max_nodes)
    wage_model.fit(X_train, y_train)
    preds = wage_model.predict(X_test)
    r2 = r2_score(y_test, preds)
    return r2
