import streamlit as st
import pandas as pd
import numpy as np
import joblib

# Load the saved model
model = joblib.load('wage_prediction_rf_model.pkl')

# Create a function to predict player wages
def predict_player_wage(overall, potential, age, nationality, attacking_wr, defensive_wr):
    nationalities = ['Argentina', 'Brazil', 'England', 'France', 'Germany', 'Italy', 'Netherlands', 'Portugal', 'Spain']
    nationality_map = {k: v for v, k in enumerate(nationalities)}
    attacking_wrs = ['High', 'Low', 'Medium']
    attacking_wr_map = {k: v for v, k in enumerate(attacking_wrs)}
    defensive_wrs = ['High', 'Low', 'Medium']
    defensive_wr_map = {k: v for v, k in enumerate(defensive_wrs)}
    nationality_level = nationality_map[nationality]
    attacking_wr_level = attacking_wr_map[attacking_wr]
    defensive_wr_level = defensive_wr_map[defensive_wr]
    input_data = np.array([[overall, potential, age, nationality_level, attacking_wr_level, defensive_wr_level]])
    predicted_wage = model.predict(input_data)
    return predicted_wage[0]

# Set up the Streamlit app
st.title('FIFA Player Wage Prediction App')

# Add input fields for user to enter player stats
overall = st.slider('Overall', 1, 99, 50)
potential = st.slider('Potential', 1, 99, 50)
age = st.slider('Age', 16, 50, 20)
nationality = st.selectbox('Nationality', ['Argentina', 'Brazil', 'England', 'France', 'Germany', 'Italy', 'Netherlands', 'Portugal', 'Spain'])
attacking_wr = st.selectbox('Attacking Work Rate', ['High', 'Low', 'Medium'])
defensive_wr = st.selectbox('Defensive Work Rate', ['High', 'Low', 'Medium'])

# Call the predict_player_wage function with the user inputs
